import react , {useEffect , useState} from "react";
import { useParams } from "react-router";

const FiveDayForecast = (props) => {

    const [data,setData] = useState();
    const params = useParams();


    const fetchData = ( async () => {
        const response = await fetch(`https://api.openweathermap.org/data/2.5/forecast?q=${params.cityId}&units=metric&appid=5a4e05662564bdefbc9d1b3d65c255f0`);
        const res = await response.json();
        console.log(res); 
        setData(res);
    });

    useEffect(() => {
        fetchData();
    }, []);

    let content = <p>Nema nista</p>;

    if (data) {
        //content = <p>{data.list[0].weather.icon}</p>
        //content = <icon>{data.list[0].weather[0].icon+".png"}</icon>
        content = <icon src={data.list[0].weather[0].icon+".jpg"}/>
    }


    return(
        <div>
            <div>Ovo je petodnevna prognoza</div>
            <section>{content}</section>
        </div>
    );
}

export default FiveDayForecast;
